import React from 'react'

export const Myreviewss = () => {
    return (
        <div>
               <h1 className="db">My Reviews (6) </h1>
           <h2 className="bi">December 3 , 2019</h2>
           <h3 className="bi">Loved Styling for kids this day! i had so much fun </h3>
           <br/>
           <h2 className="bi">October 4 ,2019  </h2>
           <h3 className="bi">Today was a little bet busy but i handled that cause of my costumers trust </h3>


        </div>
    )
}
